import css from './Calculator.module.css';

export const Calculator = ({
  valueFrom,
  valueTo,
  currency,
  onChangeFromValue,
  onChangeToValue,
  onChangeCurrency,
}) => {
  return (
    <>
      <div id="rate" className={css.exchange__rate__thumb}>
        <div className={css.title} id="title"></div>
        <ul className={css.exchange__rate}>
          <li className={css.exchange}>
            <label>
              Отдаёте:
              <input
                className={css.exchange__input__give}
                placeholder=""
                valueFrom={valueFrom}
                onChange={e => onChangeFromValue(e.target.value)}
                type="number"
              />
            </label>
          </li>
          <li className={css.exchange}>
            <label>
              Получаете:
              <input
                className={css.exchange__input__get}
                placeholder=""
                valueTo={valueTo}
                onChange={e => onChangeToValue(e.target.value)}
                type="number"
              />
            </label>
          </li>
          <li>
            <button className={css.exchange__button} type="button">
              СОЗДАТЬ ЗАЯВКУ НА ОБМЕН
            </button>
          </li>
        </ul>
      </div>
    </>
  );
};
export default Calculator;
